INSERT INTO `qa` (`id`, `question`, `answer`, `created_at`, `updated_at`) VALUES
(1, 'What would you like Give us an idea of the logo you&#039;re looking for with our quick and easy form?', 'Unlike all of our other signs which are printed directly onto the material, our vinyl lettering is created from colored vinyl. Our machines and production staff then cut and weed (remove the excess) and apply the transfer tape to your lettering to prepare it for installation. Because we do not print on cut vinyl, the number of colors to choose from is limited. If you are interested in a design with gradients or many colors within the design, vinyl lettering is not a fit. But we can still help you, so please contact us.', NULL, '2016-08-23 07:14:10'),
(3, 'What is your vinyl lettering made from?', 'Unlike all of our other signs which are printed directly onto the material, our vinyl lettering is created from colored vinyl. Our machines and production staff then cut and weed (remove the excess) and apply the transfer tape to your lettering to prepare it for installation. Because we do not print on cut vinyl, the number of colors to choose from is limited. If you are interested in a design with gradients or many colors within the design, vinyl lettering is not a fit. But we can still help you, so please contact us.', NULL, '2016-08-23 07:14:30'),
(4, 'Do you offer alternative types of vinyl lettering like reflective or marine vinyl?', 'Unlike all of our other signs which are printed directly onto the material, our vinyl lettering is created from colored vinyl. Our machines and production staff then cut and weed (remove the excess) and apply the transfer tape to your lettering to prepare it for installation. Because we do not print on cut vinyl, the number of colors to choose from is limited. If you are interested in a design with gradients or many colors within the design, vinyl lettering is not a fit. But we can still help you, so please contact us.', NULL, '2016-08-23 07:14:44');

